B.TP=new A.aW("\u062b\u0627\u0646\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0646\u064a\u062a\u0631\u0648\u062c\u064a\u0646 (NO2): \u064a\u0633\u0628\u0628 \u062a\u0647\u064a\u0651\u062c \u0641\u064a \u0627\u0644\u0642\u0635\u0628\u0627\u062a \u0627\u0644\u0647\u0648\u0627\u0626\u064a\u0629\u060c \u0648\u064a\u0641\u0627\u0642\u0645 \u0645\u0646 \u062d\u062f\u0629 \u0646\u0648\u0628\u0627\u062a \u0627\u0644\u0631\u0628\u0648.\n\n\u062b\u0627\u0646\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0643\u0628\u0631\u064a\u062a (SO2): \u0627\u0644\u062a\u0647\u0627\u0628 \u0627\u0644\u0634\u0639\u0628 \u0627\u0644\u0647\u0648\u0627\u0626\u064a\u0629 \u0648\u0636\u064a\u0642 \u0641\u064a \u0627\u0644\u062a\u0646\u0641\u0633 \u0648\u0627\u0644\u0633\u0639\u0627\u0644.\n\n\u0627\u0644\u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0639\u0636\u0648\u064a\u0629 \u0627\u0644\u0645\u062a\u0637\u0627\u064a\u0631\u0629 (VOCs): \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u064a \u0633\u0645\u064a\u0629 \u0625\u0646\u062c\u0627\u0628\u064a\u0629\u060c \u0648\u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u064a \u0643\u0648\u0646\u0647\u0627 \u0645\u0633\u0631\u0637\u0646\u0629 (\u0645\u062b\u0644 \u0627\u0644\u0641\u0648\u0631\u0645\u0627\u0644\u062f\u064a\u0647\u0627\u064a\u062f \u0648\u0627\u0644\u0628\u0646\u0632\u064a\u0646).\n\n\u0627\u0644\u0641\u0648\u0631\u0645\u0627\u0644\u062f\u064a\u0647\u0627\u064a\u062f \u0648\u0627\u0644\u0628\u0646\u0632\u064a\u0646: \u0645\u062b\u0628\u062a\u0629 \u0623\u0646\u0647\u0627 \u0645\u0648\u0627\u062f \u0645\u0633\u0631\u0637\u0646\u0629.\n\n\u062f\u062e\u0627\u0646 \u0627\u0644\u062a\u0628\u063a: \u0633\u0631\u0637\u0627\u0646 \u0627\u0644\u0631\u0626\u0629.\n\n\u0627\u0644\u062c\u0633\u064a\u0645\u0627\u062a \u0627\u0644\u062f\u0642\u064a\u0642\u0629 (\u0628\u0645\u0627 \u0641\u064a \u0630\u0644\u0643 \u0627\u0644\u0623\u0633\u0628\u0633\u062a\u0648\u0633): \u0645\u0648\u0627\u062f \u0645\u0633\u0631\u0637\u0646\u0629\u060c \u0648\u062a\u0641\u0627\u0642\u0645 \u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0646\u0641\u0633\u064a \u0648\u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.\n\n\u0623\u062d\u0627\u062f\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0643\u0631\u0628\u0648\u0646 (CO): \u062a\u0641\u0627\u0642\u0645 \u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.\n\n\u063a\u0627\u0632 \u0627\u0644\u0631\u0627\u062f\u0648\u0646: \u0633\u0631\u0637\u0627\u0646 \u0627\u0644\u0631\u0626\u0629.",null,B.a0,B.y,null,null,null,null,null)
