B.TY=new A.aW("\u064a\u062d\u0635\u0644 \u062a\u0644\u0648\u062b \u0627\u0644\u0645\u064a\u0627\u0647 \u0644\u0623\u0633\u0628\u0627\u0628 \u0645\u062e\u062a\u0644\u0641\u0629. \u0645\u0646 \u0627\u0644\u0645\u0645\u0643\u0646 \u0623\u0646 \u064a\u0623\u062a\u064a \u0645\u0646 \u0627\u0644\u062a\u0644\u0648\u062b \u0627\u0644\u0635\u0646\u0627\u0639\u064a (\u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0642\u0648\u0627\u0631\u0628 \u0641\u064a \u0627\u0644\u0628\u062d\u0627\u0631\u060c \u062a\u0635\u0631\u064a\u0641 \u0627\u0644\u0645\u0648\u0627\u062f \u0627\u0644\u0643\u064a\u0645\u064a\u0627\u0626\u064a\u0629)\u060c \u0627\u0644\u062a\u0644\u0648\u062b \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u0632\u0631\u0627\u0639\u0629 (\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0648\u0627\u062f \u0627\u0644\u0643\u064a\u0645\u064a\u0627\u0626\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u0644\u0648\u062b \u0627\u0644\u0645\u064a\u0627\u0647 \u0627\u0644\u062c\u0648\u0641\u064a\u0629 \u0648\u0627\u0644\u0633\u0637\u062d\u064a\u0629)\u060c \u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0646\u0641\u0637 \u0623\u0648 \u0627\u0644\u0648\u0642\u0648\u062f \u0641\u064a \u0627\u0644\u0645\u062c\u0627\u0631\u064a \u0627\u0644\u0645\u0627\u0626\u064a\u0629 \u0623\u0648 \u0639\u062f\u0645 \u0645\u0639\u0627\u0644\u062c\u0629 \u0645\u064a\u0627\u0647 \u0627\u0644\u0635\u0631\u0641 \u0627\u0644\u0635\u062d\u064a.",null,B.a0,B.y,null,null,null,null,null)
B.TZ=new A.aW("\u062b\u0627\u0646\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0646\u064a\u062a\u0631\u0648\u062c\u064a\u0646 (NO2): \u064a\u0633\u0628\u0628 \u062a\u0647\u064a\u0651\u062c \u0641\u064a \u0627\u0644\u0642\u0635\u0628\u0627\u062a \u0627\u0644\u0647\u0648\u0627\u0626\u064a\u0629\u060c \u0648\u064a\u0641\u0627\u0642\u0645 \u0645\u0646 \u062d\u062f\u0629 \u0646\u0648\u0628\u0627\u062a \u0627\u0644\u0631\u0628\u0648.\n\n\u062b\u0627\u0646\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0643\u0628\u0631\u064a\u062a (SO2): \u0627\u0644\u062a\u0647\u0627\u0628 \u0627\u0644\u0634\u0639\u0628 \u0627\u0644\u0647\u0648\u0627\u0626\u064a\u0629 \u0648\u0636\u064a\u0642 \u0641\u064a \u0627\u0644\u062a\u0646\u0641\u0633 \u0648\u0627\u0644\u0633\u0639\u0627\u0644.\n\n\u0627\u0644\u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0639\u0636\u0648\u064a\u0629 \u0627\u0644\u0645\u062a\u0637\u0627\u064a\u0631\u0629 (VOCs): \u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0646\u0641\u0633\u064a \u0648\u062a\u0647\u064a\u062c \u0627\u0644\u0639\u064a\u0646 \u0648\u0627\u0644\u0623\u0646\u0641 \u0648\u0627\u0644\u062d\u0644\u0642 \u0648\u0631\u062f\u0648\u062f \u0627\u0644\u0641\u0639\u0644 \u0627\u0644\u062a\u062d\u0633\u0633\u064a\u0629.\n\n\u0623\u062d\u0627\u062f\u064a \u0623\u0648\u0643\u0633\u064a\u062f \u0627\u0644\u0643\u0631\u0628\u0648\u0646 (CO): \u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0646\u0641\u0633\u064a \u0648\u0627\u0644\u0635\u062f\u0627\u0639 \u0648\u0627\u0644\u062f\u0648\u062e\u0629 \u0648\u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0647\u0636\u0645\u064a \u0648\u0627\u0644\u0627\u062e\u062a\u0646\u0627\u0642. \u0625\u0646\u0647 \u063a\u0627\u0632 \u0645\u0645\u064a\u062a \u0628\u062c\u0631\u0639\u0627\u062a \u0639\u0627\u0644\u064a\u0629.\n\n\u0627\u0644\u062c\u0633\u064a\u0645\u0627\u062a \u0627\u0644\u062f\u0642\u064a\u0642\u0629 (\u0628\u0645\u0627 \u0641\u064a \u0630\u0644\u0643 \u062d\u0628\u0648\u0628 \u0627\u0644\u0644\u0642\u0627\u062d \u0648\u062f\u062e\u0627\u0646 \u0627\u0644\u062a\u0628\u063a): \u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629 \u0648\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629. \u0648\u0645\u062f\u0649 \u062a\u0623\u062b\u064a\u0631\u0647\u0627 \u064a\u0639\u062a\u0645\u062f \u0639\u0644\u0649 \u0627\u0644\u0645\u0644\u0648\u062b\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u062d\u0645\u0644\u0647\u0627.",null,B.a0,B.dn,null,null,null,null,null)
B.U_=new A.aW("\u062a\u0639\u062a\u0628\u0631 \u0627\u0644\u062a\u0631\u0628\u0629 \u0645\u0644\u0648\u062b\u0629 \u0639\u0646\u062f\u0645\u0627 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u062a\u0631\u0643\u064a\u0632 \u063a\u064a\u0631 \u0637\u0628\u064a\u0639\u064a \u0645\u0646 \u0627\u0644\u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0643\u064a\u0645\u064a\u0627\u0626\u064a\u0629 \u0627\u0644\u062a\u064a \u064a\u062d\u062a\u0645\u0644 \u0623\u0646 \u062a\u0643\u0648\u0646 \u062e\u0637\u0631\u0629 \u0639\u0644\u0649 \u0635\u062d\u0629 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0623\u0648 \u0627\u0644\u062d\u064a\u0648\u0627\u0646 \u0623\u0648 \u0627\u0644\u0646\u0628\u0627\u062a\u0627\u062a\u060c \u062b\u0645 \u064a\u062d\u062f\u062b \u0627\u0644\u062a\u0644\u0648\u062b \u0625\u0645\u0627 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0647\u0636\u0645\u064a (\u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0625\u0633\u062a\u0647\u0644\u0627\u0643)\u060c \u0623\u0648 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0646\u0641\u0633\u064a (\u0627\u0644\u063a\u0628\u0627\u0631 \u0645\u0646 \u0627\u0644\u062a\u0631\u0628\u0629 \u0627\u0644\u0645\u0644\u0648\u062b\u0629 \u0641\u064a \u0627\u0644\u063a\u0644\u0627\u0641 \u0627\u0644\u062c\u0648\u064a).\n\n\u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646\u060c \u062a\u0643\u0648\u0646 \u0627\u0644\u0623\u0646\u0634\u0637\u0629 \u0627\u0644\u0628\u0634\u0631\u064a\u0629 \u0647\u064a \u0645\u0635\u062f\u0631 \u062a\u0644\u0648\u062b \u0627\u0644\u062a\u0631\u0628\u0629\u060c \u0645\u062b\u0644\u0627\u064b:\n\n- \u064a\u0645\u0643\u0646 \u0644\u0644\u0645\u0646\u0634\u0622\u062a \u0627\u0644\u0635\u0646\u0627\u0639\u064a\u0629 \u0641\u064a \u062d\u0627\u0644\u0629 \u062d\u062f\u0648\u062b \u062a\u0633\u0631\u0628 \u0623\u0648 \u0648\u0642\u0648\u0639 \u062d\u0627\u062f\u062b \u0623\u0648 \u062d\u062a\u0649 \u0645\u0635\u0646\u0639 \u0645\u0647\u062c\u0648\u0631\u060c \u0623\u0646 \u062a\u062a\u0633\u0628\u0628 \u0641\u064a \u062a\u0644\u0648\u062b \u0627\u0644\u0645\u0648\u0642\u0639.\n\n- \u064a\u0639\u062f \u0627\u0646\u062a\u0634\u0627\u0631 \u0627\u0644\u0645\u0628\u064a\u062f\u0627\u062a \u0648\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0648\u0627\u0644\u0645\u062e\u0644\u0641\u0627\u062a \u0645\u0646 \u0645\u0628\u0627\u0646\u064a \u0648\u0645\u0632\u0627\u0631\u0639 \u0627\u0644\u0645\u0627\u0634\u064a\u0629\u060c \u0645\u0635\u062f\u0631\u0627\u064b \u0644\u062a\u0644\u0648\u062b \u0627\u0644\u062a\u0631\u0628\u0629\u060c \u0644\u0627 \u0633\u064a\u0645\u0627 \u0628\u0627\u0644\u0646\u064a\u062a\u0631\u0648\u062c\u064a\u0646 \u0648\u0627\u0644\u0641\u0648\u0633\u0641\u0627\u062a\u060c \u0648\u0627\u0644\u0630\u064a \u064a\u0624\u062f\u064a \u0628\u062f\u0648\u0631\u0647 \u0625\u0644\u0649 \u062a\u0644\u0648\u062b \u0627\u0644\u062c\u0631\u064a\u0627\u0646 \u0627\u0644\u0633\u0637\u062d\u064a \u0644\u0644\u0645\u0627\u0621\u060c \u0648\u0645\u0646 \u062b\u0645 \u0645\u062c\u0627\u0631\u064a \u0627\u0644\u0645\u064a\u0627\u0647.",null,B.a0,B.y,null,null,null,null,null)
